import React from 'react'
import './Gallery.css'

import Item from '../sharedComponents/Item/Item'

function Gallery(props) {
    return (
        <div className='galleryRoot'>
            <Item style={props.style} to= {props.to} itemName={props.itemName}/>
        </div>
    )
}

export default Gallery
